} from 'react-icons/gr'


function Footer()
{

    const ICON_SIZE = 30;

    return(
     <div className='footer'>
            <div className='logo'>FAST TRAVEL</div>
            <div className="nav-items">
                <div className="container">
            {Object.keys(NavItemsData).map((item) =>
            {
                return <a className="nav-item" key={item}>{NavItemsData[item].name}</a>
            })}
                </div>
            </div>

            <div className="other">
                <div className="social-media-tags">
                    <Facebook className="icon" size={ICON_SIZE} />
                    <Twitter className="icon" size={ICON_SIZE} />
                    <Instagram className="icon" size={ICON_SIZE} />
                    <Linkedin className="icon" size={ICON_SIZE} />
                </div>
                <div>Â©2021 Fast Travel. All rights reserved</div>
            </div>
     </div>

    );
}




export default Footer;
